import React from "react"
import CreateUser from "./createUser";
import Login from "./login";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";




function Auth() {

    return (
        <Router>
                   <Switch>
            <Route path="/login">
                <h1>estoy en login</h1>
            </Route>

        </Switch>
        </Router>
 
    );

}

export default Auth;
